import React from "react";

const Home = () => {
  return (
    <>
      <section id="Header">
        <div className="container-fluid">
          <div className="row">
            <div className="col-10 mx-auto">
              <h1>My PortFolio as a <strong>Web Developer</strong>.</h1>
              <h2 className="my-3">Learning to develop and enhance Web App.</h2>
              <div className="mt-3">
                <a href="" className="btn btn-outline-primary">Get Started</a>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Home;
